import React from "react";
import {
  Button,
  Header,
  Icon,
  Image,
  Menu,
  Segment,
  Sidebar
} from "semantic-ui-react";

class AnnotSidebar extends React.Component {
  renderFullAnnot() {
    console.log("full annot info:", this.props.fullAnnots.annotData);

    return this.props.fullAnnots.annotData.map(annot => {
      return (
        <div key={annot.id}>
          <p>{annot.user}</p>
          <p>{annot.text}</p>
          <p className="tags">{annot.tags.join(", ")}</p>
        </div>
      );
    });
  }

  render() {
    return (
      <div>
        <Menu.Item as="a">
          <Icon name="home" />
          Home
        </Menu.Item>
        <Menu.Item as="a">
          <Icon name="gamepad" />
          Games
        </Menu.Item>
        <Menu.Item as="a">
          <Icon name="camera" />
          Channels
        </Menu.Item>
        <Menu.Item>
          <p>{this.renderFullAnnot()}</p>
        </Menu.Item>
      </div>
    );
  }
}

export default AnnotSidebar;
